//This code will redirect to integration website
function redirectIntegration(){
    setTimeout(function(){		
        var host = window.location.pathname;		
        if(host != "/main" && host != "/checkout" && host != "/signup" && host != "/myorders" && host != "/myprofile" && host != "/myaddress" && host != "/trackorders" && host != "/addaddress" && host != "/editaddress" && host != "/ordercheckout" && host != "/home" && host != "/checkout-details") {		
            var path = "home/index.html";		
            window.location.href = path;		
        }		
    },0);	
}

